import { useForm } from "react-hook-form";

const UserData=()=>{

    const{register,handleSubmit,formState:{errors,isDirty,dirtyFields}}=useForm()

    const submitForm=(data)=>{

    }

    return(
        <>
        <div>
            <form action="" onSubmit={handleSubmit(submitForm)}>
                <input type="text" {...register("name",{required:{message:"Enter Name",value:true}})} placeholder="Enter Name" />
                <input type="email" {...register("email",{required:{message:"Enter Email",value:true}})} placeholder="Enter Email"/>
                <input type="number" {...register("email",{required:{message:"Enter Number",value:true}})} placeholder="Enter Number"/>
                <div>
                <input type="radio" value="Male" id="g" {...register("gender",{required:{message:"Please Select Gender",value:true}})}/><label htmlFor="g">Male</label>
                <input type="radio" value="female" id="e"{...register("gender",{required:{message:"Please Select Gender",value:true}})}/><label htmlFor="e">Female</label>
                </div>
                <div>
                    <select name="" id="" {...register("city",{required:{message:"Select City",value:true}})}>
                        <option value="" >Select</option>
                        <option value="Hyderabad" >Select</option>
                        <option value="Vijayawada" >Select</option>
                        <option value="Guntur" >Select</option>
                    </select>
                </div>
            </form>
        </div>
        </>
    )
}


export default UserData;
